[console]::foregroundcolor = 'white'
[console]::backgroundcolor = 'black'

function Set-ConsoleSize{

[CmdletBinding()]
Param(
     [Parameter(Mandatory=$False,Position=0)]
     [int]$Height = 40,
     [Parameter(Mandatory=$False,Position=1)]
     [int]$Width = 120
     )
$console = $host.ui.rawui
$ConBuffer  = $console.BufferSize
$ConSize = $console.WindowSize

$currWidth = $ConSize.Width
$currHeight = $ConSize.Height

# if height is too large, set to max allowed size
if ($Height -gt $host.UI.RawUI.MaxPhysicalWindowSize.Height) {
    $Height = $host.UI.RawUI.MaxPhysicalWindowSize.Height
}

# if width is too large, set to max allowed size
if ($Width -gt $host.UI.RawUI.MaxPhysicalWindowSize.Width) {
    $Width = $host.UI.RawUI.MaxPhysicalWindowSize.Width
}

# If the Buffer is wider than the new console setting, first reduce the width
If ($ConBuffer.Width -gt $Width ) {
   $currWidth = $Width
}
# If the Buffer is higher than the new console setting, first reduce the height
If ($ConBuffer.Height -gt $Height ) {
    $currHeight = $Height
}
# initial resizing if needed
$host.UI.RawUI.WindowSize = New-Object System.Management.Automation.Host.size($currWidth,$currHeight)

# Set the Buffer
$host.UI.RawUI.BufferSize = New-Object System.Management.Automation.Host.size($Width,2000)

# Now set the WindowSize
$host.UI.RawUI.WindowSize = New-Object System.Management.Automation.Host.size($Width,$Height)

}

Set-ConsoleSize -Height 78 -Width 200

Set-Location HKCU:\Console
New-Item '.\%SystemRoot%_System32_WindowsPowerShell_v1.0_powershell.exe'
Set-Location '.\%SystemRoot%_System32_WindowsPowerShell_v1.0_powershell.exe'
New-ItemProperty . FaceName -type STRING -value "Lucida Console"
New-ItemProperty . FontFamily -type DWORD -value 0x00000036
New-ItemProperty . FontSize -type DWORD -value 0x000c0000
New-ItemProperty . FontWeight -type DWORD -value 0x00000190

Set-ConsoleFont 6
Set-Location C:\

$Base64Mp3 = ""

$UserDownloads = (New-Object -ComObject Shell.Application).NameSpace('shell:Downloads').Self.Path

$decodedMp3FilePath = "$($UserDownloads)\Skull.mp3"

$vlcPath = $null

if (Test-Path -Path "C:\Program Files\VideoLAN\VLC\vlc.exe") {$vlcPath = "C:\Program Files\VideoLAN\VLC\vlc.exe"}
if (Test-Path -Path "C:\Program Files (x86)\VideoLAN\VLC\vlc.exe") {$vlcPath = "C:\Program Files (x86)\VideoLAN\VLC\vlc.exe"}


# Decode the Base64 string back to binary and save it as a new MP3 file
[System.IO.File]::WriteAllBytes($decodedMp3FilePath, [Convert]::FromBase64String($Base64Mp3))

# Command to play the MP3 file with VLC minimized
$vlcArgs = "--qt-start-minimized ""$($decodedMp3FilePath)"""

# Start VLC and play the decoded MP3 file minimized
Start-Process -FilePath $vlcPath -ArgumentList $vlcArgs


